import React from 'react';
import LegalDashboard from './components/LegalDashboard';

const Legal = () => {
  return (
    <div className="space-y-6">
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Legal & Compliance</h1>
          <p className="text-gray-600">Manage legal documents, compliance requirements, and regulatory filings.</p>
        </div>
      </div>

      <LegalDashboard />
    </div>
  );
};

export default Legal;
